#include<iostream>
#include<unordered_map>
using namespace std;
int main()
{
    string str;
    cout<<"Enter string:"<<endl;
    cin>>str;
    unordered_map<char,int>hm;
    string res="";
    for(char c:str)
    {
        if(hm.find(c)!=hm.end())
        {
            continue;
        }
        hm[c]++;
        res = res+c;
    }
    cout<<"Output is:\n";
    cout<<res;

}
